import './Header.css'

import Container from 'react-bootstrap/Container';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';

function Header() {
  return (
    <Navbar expand="lg" className="bg-body-tertiary">
        <Container>
            <Navbar.Brand href="#home" className = "navbar-brand">Welbex<br/> <span>крупный интегратор CRM<br/> в России и еще 8 странах</span></Navbar.Brand>
            <Navbar.Toggle aria-controls="basic-navbar-nav" />
            <Navbar.Collapse id="basic-navbar-nav">
                <Nav className="me-auto">
                    <Nav.Link href="#home">Услуги</Nav.Link>
                    <Nav.Link href="#link">Виджеты</Nav.Link>
                    <Nav.Link href="#link">Интеграции</Nav.Link>
                    <Nav.Link href="#link">Кейсы</Nav.Link>
                    <Nav.Link href="#link">Сертификаты</Nav.Link>
                </Nav>
            </Navbar.Collapse>
        </Container>
    </Navbar>
  );
}

export default Header;
